import Container from "../components/container/Container";
import { Row, Col } from "react-simple-flex-grid";
import className from "classnames";

export default () => (
  <div className="home-bg" style={{ marginTop: "5rem", position: "fixed" }}>
    <Row style={{ padding: "10rem", height: "80vh" }}>
      <Col md={7}>
        <h1 style={{ textAlign: "justify", color: "blue", fontSize: "3rem" }}>
          Hello Folks, we are Transcend Studio.
        </h1>
      </Col>
    </Row>
  </div>
);
